('0000000977','{\"description\":\"Handicrafts of home decors. Crafted by artist of India. Carry Indian traditional culture. Made in-India. Size- inch Color- Glossy Blue Material- Gamar wood •Vintage Wooden Carved Mask •Gomera mask (Also known as Gamira mask) masis a part of Gomera dance which is originated in North and South Dinajpur of West Bengal. The word Gomera is colloquial from Gram-Chandi, a female deity. •This mask is used on the wall. It is also called Mukha Khel meaning the game of masks.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000000979','{\"description\":\"The Tribal Mask Associated With The Age-Old Dance Form Called As Chhau Of Purulia Region Of West Bengal Are Acclaimed For Their Craftsmanship. The Performers Wear The Masks Of Various Mythological Characters And Animals Incorporating Elements Of Martial Arts Into Their Movements Narrating Mythological Stories. The tradition of making Chhau masks started during the rule of king Madan Mohan Singh Deo of Baghmundi. It is traditionally associated with the age-old dance forms in Purulia, West Bengal. The Chhau Mask has ferocious facial expressions, bloodshot eyes, wide dilated nostrils, wrinkled skin, and open mouth from which fangs come out. The masks are made up of paper pulp, mud, and clay subsequently dried in the sun to make it hard. The masks are then colorfully painted. The eye and nose areas have holes to enable vision and breathing. Finally, the masks are decorated with zari and other adornments. The masks have feathers and other ornaments that surround the face part of the mask.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
