('0000001031','{\"description\":\"Banshi Handicrafts and Arts 18CM Brass Ganesh Deepak, Temple Decor Ganesha Statue, Diwali gift, Ganesh Sculpture, Hindu gods of good luck. On Diwali, it is a custom to worship Goddess Lakshmi and Lord Ganesha together. It is well-known that Goddess Lakshmi is the Goddess of wealth, fortune, luxury and prosperity (both material and spiritual) while Lord Ganesha is revered as the remover of obstacles, the patron of arts and sciences and the ‘Deva’ of intellect and wisdom. It is believed that those who worship Lakshmi without Ganesha are not blessed by the Goddess. Hence, Lakshmi is always worshipped along with Ganesha on Diwali. Gaining wealth without intellect will only result in misusing the wealth. So, one must first acquire the intelligence to spend the wealth in the right manner. Therefore, Lakshmi and Ganesha are worshipped together. A UNIQUE DECORATION FOR THE HOME Brass metal art oil lamp for puja offering This pleases the Lord and also removes away all negative energies from the\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000001033','{\"description\":\"Tree of Life – Madhubani or the Mithila art is a style of Indian painting practiced in the Mithila region of the Indian subcontinent. This painting is done with a variety of tools, including fingers, twigs, brushes, nib-pens, and matchsticks, and using natural dyes and pigments. It is characterized by its eye-catching geometrical patterns. There is ritual content for particular occasions, such as birth or marriage, and festivals, such as Holi, Surya Shasti, Kali Puja, Upanayana, and Durga Puja. Madhubani the painting also referred to as Mithila Art (as it flourishes in the Mithila region of Bihar), is characterized by line drawings filled in by bright colors and contrasts or patterns. Traditionally, the painting was one of the skills that were passed down from generation to generation in the families of the Mithila region, mainly by women. Madhubani art has five distinctive styles: Bharni, Kachni, Tantrik, Godna, and Khobar. Madhubani paintings use two-dimensional imagery, and generall\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
