('0000001055','{\"description\":\"A door valance, also known as a toran or bandhanwar, is a decorative hanging ornament or garland that is traditionally placed on or above the entrance door of homes in many South Asian countries, particularly in India. It adds a touch of beauty and elegance to the doorway and is often used during special occasions, festivals, or religious ceremonies. A door valance typically consists of a long, ornate fabric or thread decoration that is suspended horizontally across the top of the doorframe. It may be made of various materials such as silk, cotton, beads, mirrors, sequins, and embroidery. The design and color scheme of the valance can vary greatly, reflecting the cultural diversity and regional traditions. The toran or bandhanwar is usually handcrafted with intricate patterns and motifs, showcasing the craftsmanship and artistic skills of the artisans. It often incorporates elements from nature, religious symbols, or auspicious symbols that are considered to bring good luck and prosper\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000001057','{\"description\":\"A traditional multicolor adjustable rangoli is a beautiful and vibrant decorative art form originating from India. Rangoli is typically created on the ground or floor using colored powders, rice, grains, flowers, or even colored sand. It is a form of temporary artwork that is made during festivals, weddings, or other auspicious occasions. The multicolor aspect of the rangoli refers to the use of various hues and shades to create a visually stunning design. Rangolis often incorporate a wide range of colors, including red, yellow, green, blue, orange, pink, and purple. These colors are used to draw intricate patterns, motifs, and geometrical shapes. One unique feature of the traditional multicolor adjustable rangoli is its adjustability. It allows the artist or creator to modify and rearrange the design as per their preference or the available space. This flexibility is achieved through the use of loose colored powders or grains that can be easily shifted or rearranged. To create a tradi\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
