('0000001081','{\"description\":\"The Brass Dining Raja Set is an exquisite and luxurious dining set made from brass, a durable and elegant metal alloy. This dining set showcases traditional Indian craftsmanship and design, making it a statement piece for any dining room. The set typically includes a table and a matching set of chairs. The table is often rectangular or round in shape, featuring intricate brass carvings and detailing on its surface and legs. The chairs complement the table with similar brass carvings on the backrest and legs. The seating is usually padded and upholstered in a rich fabric, enhancing both comfort and style. One of the defining features of the Brass Dining Raja Set is its ornate and regal appearance. The brass carvings often depict intricate motifs inspired by Indian culture, such as floral patterns, peacocks, elephants, or traditional architectural elements. These carvings are meticulously crafted, showcasing the skill and artistry of the artisans who create them. The brass used in the se\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000001085','{\"description\":\"Decors Maa Akhand Diya Dokra is a unique and exquisite piece of decor that combines traditional craftsmanship with contemporary design. It is a handcrafted diya (oil lamp) made using the ancient art of Dokra, which is a metal casting technique practiced by tribal artisans in India. The Maa Akhand Diya Dokra is named after the Hindu goddess \"Maa\" (mother) and \"Akhand\" (unbroken) as it symbolizes the eternal flame that represents divinity and spirituality. The diya is crafted in a traditional shape with a wide circular base and a tall, tapering stem that culminates in a beautifully crafted lamp holder. What makes the Decors Maa Akhand Diya Dokra truly special is the intricate detailing and craftsmanship involved in its creation. Dokra artisans use a wax casting method to create a clay core, which is then coated with a mixture of clay, hay, and cow dung. This mold is heated in a furnace, and molten metal, typically brass or bronze, is poured into it. The unique aspect of Dokra art is that\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
