('0000001636','{\"description\":\"Dhokra brass metal tribal farmers are skilled artisans belonging to the Dhokra tribe, an indigenous community primarily found in parts of Eastern and Central India. The Dhokra art form, also known as the lost-wax technique, is an ancient method of metal casting that has been practiced by the tribe for generations. These tribal farmers possess a unique blend of agricultural expertise and artistic talent. They engage in farming as their primary occupation, cultivating crops like rice, wheat, pulses, and vegetables to sustain their livelihoods. Agriculture is deeply rooted in their cultural heritage, and they have an intimate understanding of the local soil, climate, and traditional farming techniques. In addition to their agricultural pursuits, Dhokra farmers are renowned for their exquisite brass metalwork. Using the lost-wax technique, they create intricate and detailed sculptures, jewelry, and decorative items. The process involves crafting a clay core and applying a layer of wax over\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000001637','{\"description\":\"Brass Dhokra Tortoise Home Decor is a decorative item that showcases the traditional Dhokra art form using brass metalwork. The Dhokra technique, known as the lost-wax casting, is employed to create an intricately designed tortoise sculpture for home adornment. The tortoise holds symbolic significance in various cultures, representing longevity, wisdom, and stability. In the context of Dhokra art, the brass tortoise serves as a beautiful and meaningful decorative piece that can enhance the aesthetic appeal of any living space. The Dhokra process begins with skilled artisans crafting a clay core in the shape of a tortoise. Over this core, a layer of wax is carefully applied and meticulously sculpted to capture the details and form of the tortoise. The wax sculpture is then coated with a layer of clay, creating a mold. Once the mold is ready, molten brass is poured into it, replacing the wax, and allowed to solidify. After cooling and solidification, the clay mold is broken, revealing th\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
