('0000002257','{\"description\":\"A mul cotton plain saree is a traditional Indian garment made from a lightweight and breathable fabric called \"mul cotton.\" Mul cotton, also known as \"muslin cotton,\" is a delicate and finely woven fabric that is known for its soft texture and comfort. It is often used to create sarees, as well as other traditional clothing. Here\'s a more detailed description of a mul cotton plain saree: Fabric: Mul cotton is characterized by its sheer and airy quality. It is made from fine cotton yarns that are woven closely together, resulting in a lightweight and breathable fabric. This makes it an excellent choice for sarees, especially in warmer climates. Texture: The texture of mul cotton is smooth and soft, allowing the saree to drape elegantly. Despite its delicate appearance, mul cotton is known for its durability and becomes softer with each wash, enhancing the comfort factor. Plain Design: A plain mul cotton saree refers to a saree that lacks intricate patterns or heavy embellishments. These\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
