('0000002879','{\"description\":\"Women\'s black potlis are stylish and versatile accessories that often serve as traditional Indian or South Asian handbags. These potlis are typically small pouches or bags that are held by a drawstring or a decorative string closure. They come in various shapes and designs, often adorned with intricate embroidery, beads, sequins, or other embellishments. The color black is timeless and elegant, making black potlis a popular choice for formal occasions, parties, weddings, and cultural events. They can be made from a variety of materials such as silk, velvet, satin, or brocade, offering a luxurious and sophisticated look. These accessories are not just fashionable but also functional, providing enough space to carry essentials like keys, phones, makeup, and other small items. They add a touch of glamour to ethnic attire like sarees, lehengas, or even contemporary outfits, complementing a wide range of styles and ensembles.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
