('0000002900','{\"description\":\"A Kantha patchwork shoulder bag is a stunning and unique accessory that showcases the artistry of the Kantha embroidery technique. Originating from Bengal in the Indian subcontinent, Kantha embroidery involves the intricate stitching of colorful threads onto fabric, creating beautiful and elaborate patterns. The shoulder bag typically features a fabric base adorned with patches of vibrant and intricately embroidered cloth. These patches are often created by stitching together layers of old saris or fabric scraps, resulting in a rich tapestry of colors and patterns. The designs on a Kantha patchwork shoulder bag can vary widely, from floral motifs to geometric shapes, animals, or even storytelling elements. Each bag is a piece of art, showcasing the skillful craftsmanship and creativity of the artisans who meticulously stitch together these diverse patterns. In terms of construction, these bags usually have a spacious main compartment secured with a zipper or a button closure, providing\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
