('0000003385','{\"description\":\"Terracotta, the ancient art form which flows the earth into our souls. Originating in the Indus Valley Civilization, the art form has adapted & enriched over the years with artisans uninhibited in their imagination and creativity. As per Hindu beliefs, the five elements of air, water, earth, fire, and ether lends this artform an air of mystery and auspiciousness. The terracotta art form came to Bengal in the 16th century with the influence of Vaishnavite movement which found expression in Terracotta sculpting on Krishna temples. Rural Bengal is a treasure trove of finely crafted terracotta pots, figurines including those of handsome horses and other items, small and large, practical as well as decorative. Bring an ethnic touch to your home decor with this rustic ma durga statue.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
