('0000003387','{\"description\":\"Terracotta Saraswati Krisnanagar is a unique and culturally significant site located in Krisnanagar, a city in the Nadia district of West Bengal, India. It is known for its exquisite terracotta artwork and the presence of numerous terracotta sculptures depicting the Hindu goddess Saraswati. Terracotta art is a form of pottery where clay is molded into various shapes and then baked to harden. It has been a popular art form in India for centuries, and Krisnanagar is renowned for its skilled artisans who specialize in creating intricate terracotta sculptures. The focal point of Terracotta Saraswati Krisnanagar is the depiction of Saraswati, the goddess of knowledge, music, arts, and wisdom in Hindu mythology. Saraswati is often portrayed as a beautiful woman adorned with traditional garments, playing a musical instrument called the veena, and seated on a lotus flower. At Terracotta Saraswati Krisnanagar, visitors can witness a wide range of terracotta sculptures featuring Saraswati in var\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
