('0000003395','{\"description\":\"Bankura Bulls 1 Pair Love Couple | Bankura Bengal Terracotta Sculpture Motif Figurine | Baked Earth Earthen/ Clay/ Terracotta Pots/ Vase Set I Interior Home Decor Decoration Decorative Gift Items I Handcrafted Handmade Handicraft Artwork I Shelf Table Top Show Piece I Living Room Bedroom Office Waiting Hall Lounge I Artisan Folk Art & Craft. TERRACOTTA : Terra cotta, or terra-cotta (pronounced [ˌtɛrraˈkɔtta]; Italian: \"baked earth\", from the Latin terra cocta), a type of earthenware, is a clay-based unglazed or glazed ceramic, where the fired body is porous. Terracotta is the term normally used for sculpture made in earthenware, and also for various practical uses including vessels (notably flower pots), water and waste water pipes, roofing tiles, bricks, and surface embellishment in building construction.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
