('0000003447','{\"description\":\"Terracotta Maa Durga idol is a handcrafted clay sculpture depicting the powerful Hindu goddess Durga. Traditionally made from baked clay, this sculpture showcases the intricate details of the goddess, often portrayed with multiple arms holding symbolic weapons, riding a lion or tiger, symbolizing strength and protection. The earthy tones of terracotta add a natural, rustic charm to the idol, making it an ideal decorative piece for spiritual spaces or festive celebrations like Durga Puja. It reflects traditional artistry and religious significance.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003448','{\"description\":\"Stay healthy and eco-conscious with our handcrafted Clay Water Bottle, designed to naturally cool your water and enhance its taste. Made from 100% natural clay, this bottle is a sustainable alternative to plastic, helping to preserve the environment while keeping you hydrated. Perfect for home, office, or on-the-go use, it promotes health and wellness with every sip.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003450','{\"description\":\"Save in style with our handcrafted Clay Gullak Coin Bank, a traditional and eco-friendly way to manage your coins. Made from 100% natural clay, this durable coin bank is perfect for teaching kids the value of saving or as a charming addition to your home décor. A sustainable alternative to plastic, it adds a nostalgic touch to any space while helping you save for the future.\"\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003451','{\"description\":\"Transform your home décor with our Terracotta Handpainted Vase, a beautiful fusion of traditional craftsmanship and vibrant artistry. Handcrafted from natural terracotta and adorned with intricate hand-painted designs, this vase adds a unique, rustic charm to any space. Ideal for fresh or dried flowers, it’s a perfect piece to enrich your living room, bedroom, or office with an eco-friendly touch\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003452','{\"description\":\"Bring a natural touch to your garden or home with our Terracotta Clay Flower Pot, crafted from eco-friendly, breathable clay that promotes healthy plant growth. Perfect for both indoor and outdoor use, this durable pot adds a rustic charm to any space while providing the ideal environment for your plants to thrive. Elevate your décor with this sustainable, timeless piece.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003455','{\"description\":\"Add a touch of elegance to your space with the BongoArt Terracotta Clay Flower Vase, handcrafted from natural clay and designed to showcase both fresh and dried arrangements. Featuring a rustic yet stylish finish, this eco-friendly vase is perfect for enhancing your home décor. Its durable build and timeless design make it an ideal centerpiece for any room\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003457','{\"description\":\"Enhance your home décor with our stunning Terracotta Vase, expertly crafted from high-quality terracotta. This versatile vase is perfect for displaying fresh or dried flowers, adding a rustic touch to any room. Its timeless design and natural finish make it a beautiful centerpiece for your living space, office, or garden. Bring warmth and charm to your surroundings with this eco-friendly piece.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003462','{\"description\":\"Terracotta bowl is a simple, handcrafted vessel made from baked clay, known for its earthy, natural appearance. These bowls often feature a warm, reddish-brown color and may have smooth or textured surfaces. Used for serving or as decorative pieces, terracotta bowls are durable, eco-friendly, and can add a rustic, traditional charm to any kitchen or dining space. Their porous nature also makes them ideal for keeping food cool or for displaying plants or decorative items.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003463','{\"description\":\"Terracotta jar is a handcrafted container made from baked clay, known for its warm, earthy tones and rustic appeal. These jars often have a traditional design, with smooth or textured surfaces, and are used for storing dry goods, liquids, or even as decorative pieces. The porous nature of terracotta helps regulate temperature, making it ideal for preserving contents like water, grains, or spices. In addition to their functional use, terracotta jars add a natural, timeless charm to kitchens, homes, or gardens.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003466','{\"description\":\"Matka-shaped pickle jars with lid covers are traditional storage containers made from clay or ceramic, designed in the iconic matka (pot) shape. These jars are ideal for storing pickles, spices, or condiments, with the wide mouth making it easy to fill and access the contents. The rounded body and secure lid help preserve the freshness and flavor of the pickles by keeping them airtight. Their rustic, earthy appearance adds a cultural charm to kitchens, while their practical design makes them perfect for daily use or as decorative pieces.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003469','{\"description\":\"Earthen floating bowl is a decorative piece made from natural clay, designed to float in water. These bowls are often used as ornamental items, filled with water and adorned with floating flowers, petals, or candles to create a serene and beautiful display. The earthy tones of the bowl, combined with the natural elements, make it a popular choice for home décor, especially in living rooms, patios, or gardens. Its rustic charm adds a peaceful, organic touch to any setting, perfect for festive or everyday use to enhance ambiance\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003470','{\"description\":\"Terracotta clay plate is a handcrafted dish made from natural, baked clay. Known for its earthy, reddish-brown tone, this type of plate is often used for serving food, especially in traditional or rustic settings. The porous nature of terracotta allows for heat retention, keeping food warm for longer. These plates add a natural, artisanal touch to dining experiences and are ideal for both casual and decorative purposes. Their rustic appeal makes them perfect for traditional meals or as unique, eco-friendly tableware.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003471','{\"description\":\"Terracotta plates are handcrafted dishes made from baked clay, featuring a natural, earthy reddish-brown color. These plates are often used for serving food and are prized for their rustic charm and traditional appeal. The porous nature of terracotta helps retain heat, keeping food warm longer, while adding a natural, artisanal feel to the dining experience. Suitable for both casual meals and decorative presentations, terracotta plates bring an eco-friendly and rustic touch to any table setting, blending tradition with functionality.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003472','{\"description\":\"Dish Pure Terracotta Clay - Microwave-Friendly Experience natural cooking with the Dish Pure Terracotta Clay, designed to be microwave-friendly. This eco-friendly, handcrafted dish is made from pure terracotta, offering durability and an earthy charm. Ideal for serving or reheating meals, it’s perfect for adding a sustainable, rustic touch to your kitchen.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003474','{\"description\":\"Add a rustic touch to your dining experience with The HIMALAY Craft Clay Katori Serving Bowl. Handcrafted from natural clay, this eco-friendly bowl is perfect for serving curries, dips, or snacks. Its durable, sustainable design brings a traditional charm to any table setting.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003477','{\"description\":\"Illuminate your home with the Handmade TULSI Earthen Terracotta Diya. Crafted from natural clay, this eco-friendly diya is perfect for festivals, prayers, and home decor. Its traditional design brings a warm, rustic charm, making it an ideal choice for creating a serene, spiritual atmosphere.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003478','{\"description\":\"Enhance your spiritual rituals with this elegant Dhoopstick (Agarbatti) Stand. Designed to securely hold incense sticks, it adds a touch of serenity to your space. Perfect for homes or temples, this stand is both functional and stylish, making it an ideal accessory for creating a peaceful ambiance.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003479','{\"description\":\"Enhance your spiritual rituals with this Handmade Bell for Puja, producing a clear and resonant metallic sound. Crafted with care, this bell is perfect for temples, prayer rooms, or home altars, adding an authentic touch to your daily puja and creating a serene, devotional atmosphere.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003480','{\"description\":\"Add a warm, rustic charm to your space with the Art and Illusion Terracotta Hanging Lantern. Handcrafted from natural clay, this eco-friendly lantern is perfect for both indoor and outdoor decor. Its intricate design casts beautiful shadows, creating a cozy, inviting atmosphere in any setting.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003481','{\"description\":\"Brighten your home with this elegant Terracotta Hanging Diya Set, perfect for festivals and home decor. Handcrafted from natural clay, these eco-friendly diyas bring a warm, traditional glow to any space. Ideal for indoor or outdoor use, this set adds a touch of rustic charm to your decor.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003482','{\"description\":\"Illuminate your space with the exquisite Latkan Diya, a perfect blend of tradition and elegance. Handcrafted from high-quality materials, this decorative diya features intricate designs that enhance your home decor. Ideal for festivals, celebrations, or daily rituals, it adds a warm, inviting glow to any setting.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
