('0000003485','{\"description\":\"Ganesha with musical instrument idol made with natural terracotta clay, Terracotta clay ganesha handmade with natural clay comes in natural color, its completely handmade and eco frindly, the product is handmade so size may varies a little, ideal for home/office decor, also can be use for Ganesh Chaturthi\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003487','{\"description\":\"Terracotta, the ancient art form which flows the earth into our souls. Originating in the Indus Valley Civilization, the art form has adapted & enriched over the years with artisans uninhibited in their imagination and creativity. This TERRACOTTA 13\" approx PREMIUM DESIGNER SARASWATI is an excellent piece of creativity by rural terracotta artisan of Sudh pur West Bengal. Simple realistic posture of goddess captured with earthen simplicity. Special Note: Traditional hand carved art form, Kindly allow minor crafting defects.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
