('0000003513','{\"description\":\"ThisTea Coasters painting is done with a variety of tools, including fingers, twigs, brushes, nib-pens, and matchsticks, and using natural dyes and pigments. It is characterized by its eye-catching geometrical patterns. There is ritual content for particular occasions, such as birth or marriage, and festivals, such as Holi, Surya Shasti, Kali Puja, Upanayana, and Durga Puja. Madhubani the painting also referred to as Mithila Art (as it flourishes in the Mithila region of Bihar), is characterized by line drawings filled in by bright colors and contrasts or patterns.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003517','{\"description\":\"Protect your home and loved ones with this elegant Evil Eye wall hanging. Designed to ward off negative energy and bring good luck, this decorative piece combines traditional symbolism with a modern aesthetic. Perfect for adding a touch of protection and style to your living space, doorway, or any room, it’s an ideal choice for both home and office decor Intricate Design: The intricate design and vibrant colors of this wall hanging make it a stunning addition to any space. Protective Symbol: The evil eye is a well-known symbol of protection, believed to ward off negative energy and bring good luck. Versatile Placement: Suitable for living rooms, bedrooms, offices, or any space where you want to create a sense of peace and harmony. High-Quality Materials: Made from durable and high-quality materials, this wall hanging is built to last.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
('0000003518','{\"description\":\"\"Discover a stunning fusion of Lippan and Mandala art in this exquisite wall decor piece. Handcrafted with intricate detailing, this unique combination brings together the traditional charm of Lippan art and the symmetrical beauty of Mandala designs. Perfect for adding a touch of elegance and cultural richness to any room, this wall decor enhances your space with its captivating patterns and artistic flair.\" Lippan Art: The lippan art elements add depth and texture to the design, creating a visually stunning piece. Mandala Art: The mandala pattern symbolizes harmony, balance, and spiritual enlightenment. High-Quality Materials: Made from durable and sustainable materials, this wall decor is built to last. Versatile Placement: Suitable for living rooms, bedrooms, offices, or any space where you want to add a touch of cultural sophistication.\"}','2025-07-12 18:11:54','2025-07-12 18:11:54'),
