('SKU0000000025','Sustainable fashion jewellery | festive jewellery set | handmade necklace',329,300,'necklace','Celebrate the beauty of handcrafted art with this Aesthetic Classic Terracotta Jewellery Set, a perfect fusion of tradition and style. This stunning set includes a beautifully designed necklace and matching earrings, made from eco-friendly terracotta material. Its intricate patterns and earthy tones make it a versatile accessory for ethnic wear, festive occasions, or even casual outfits.','[\"https://craftzone.in/backend/uploads/products/SKU0000000025/1274a5edd9eb3bb4c529032b8ba0eb5b.webp\",\"https://craftzone.in/backend/uploads/products/SKU0000000025/33b9b9f71e728ebdb69c36afc3ad6c7c.webp\"]','Jewellery','Jewellery',1,1),
('SKU0000000026','Leather necklace for women | stylish necklace for girls | trendy leather jewelry',329,300,'necklace','Make a bold style statement with this Leather Necklace for Women and Girls, designed for those who love unique and trendy accessories. Crafted from high-quality leather, this necklace combines durability with contemporary fashion, making it perfect for casual outings, parties, or even as a standout accessory for daily wear.','[\"https://craftzone.in/backend/uploads/products/SKU0000000026/2a1457e1cdf4f5de8c775d966bf18d49.webp\",\"https://craftzone.in/backend/uploads/products/SKU0000000026/486748cbf5808882a8281e54da2f7ca4.webp\",\"https://craftzone.in/backend/uploads/products/SKU0000000026/8b20700af5649e6c2b45c378b77c0068.webp\"]','Jewellery','Jewellery',1,1),
('SKU0000000027','Leather necklace for women | leather necklace blue | leather necklace for women',329,300,'necklace','Make a bold style statement with this Leather Necklace for Women and Girls, designed for those who love unique and trendy accessories. Crafted from high-quality leather, this necklace combines durability with contemporary fashion, making it perfect for casual outings, parties, or even as a standout accessory for daily wear.','[\"https://craftzone.in/backend/uploads/products/SKU0000000027/456c47cee5abc3c9543fc309580f7f44.webp\",\"https://craftzone.in/backend/uploads/products/SKU0000000027/22066b84e237be9ab2bd9ef31b2e2647.webp\",\"https://craftzone.in/backend/uploads/products/SKU0000000027/1dd338d418ffef9cb7f8c3bc47d33aca.webp\"]','Trending','Trending Collection',12,1),
